INSERT INTO `tx_scheduler_task` VALUES (1,1597653143,0,0,'This task calls the garbage collection of configured caching framework caches which use one of the selected backends. This will free some space in cache backends which do not have an internal garbage collection. In case of the default database backend it is advisable to run this task once a day when the database is mostly idle.',1597726200,1597659376,'','BE','O:62:\"TYPO3\\CMS\\Scheduler\\Task\\CachingFrameworkGarbageCollectionTask\":10:{s:16:\"selectedBackends\";a:4:{i:0;s:46:\"TYPO3\\CMS\\Core\\Cache\\Backend\\SimpleFileBackend\";i:1;s:49:\"TYPO3\\CMS\\Core\\Cache\\Backend\\Typo3DatabaseBackend\";i:2;s:51:\"TYPO3\\CMS\\Core\\Cache\\Backend\\TransientMemoryBackend\";i:3;s:40:\"TYPO3\\CMS\\Core\\Cache\\Backend\\FileBackend\";}s:12:\"\0*\0scheduler\";N;s:10:\"\0*\0taskUid\";i:1;s:11:\"\0*\0disabled\";b:0;s:19:\"\0*\0runOnNextCronJob\";b:0;s:12:\"\0*\0execution\";O:29:\"TYPO3\\CMS\\Scheduler\\Execution\":6:{s:8:\"\0*\0start\";i:1597653067;s:6:\"\0*\0end\";s:1:\"0\";s:11:\"\0*\0interval\";i:0;s:11:\"\0*\0multiple\";s:1:\"0\";s:10:\"\0*\0cronCmd\";s:10:\"50 4 * * *\";s:23:\"\0*\0isNewSingleExecution\";b:0;}s:16:\"\0*\0executionTime\";i:1597726200;s:14:\"\0*\0description\";s:329:\"This task calls the garbage collection of configured caching framework caches which use one of the selected backends. This will free some space in cache backends which do not have an internal garbage collection. In case of the default database backend it is advisable to run this task once a day when the database is mostly idle.\";s:12:\"\0*\0taskGroup\";i:0;s:9:\"\0*\0logger\";N;}','',0),(2,1597653378,0,0,'This task goes through a Storage and makes sures that every file is properly indexed. When files are manipulated only via the TYPO3 CMS backend, they are always indexed. However if files get added via other means (e.g. FTP) or if some Storages are based on drivers accessing remote systems, it is crucial to run this task regularly so th